import TablaCocheras from "../componentes/TablaCocheras";

const Cocheras = () => {
    return (
        <div className="cocheras-container">
            <div className="header">
                <h2>Gesti√≥n de Cocheras</h2>
                <button className="add-button">+ Asignar Nueva Cochera</button>
            </div>
            <FiltrosCocheras />
            <TablaCocheras />
        </div>
    );
};

export default Cocheras;
